import React from "react";
import { Card } from 'antd';
import APP_CONSTANTS from "constants/appConstants";

export default function DataInput() {
    const cards = APP_CONSTANTS.DATA_INPUT_CARDS;

    return (
        <>
            {
                cards.map(card => {
                    return <Card title={card.title} bordered={false} style={{ width: '100%' }}>
                        {
                            card.grid.map(cardGrid => {
                                return <Card.Grid
                                    style={{ width: '25%', textAlign: 'center'}}
                                    className={cardGrid.focus ? 'bg-primary text-white cursor-pointer' : ''}
                                >
                                    {cardGrid.label}
                                </Card.Grid>
                            })
                        }
                        <Card.Grid
                            style={{ width: '25%', textAlign: 'center'}}
                        >
                            Ethernet
                        </Card.Grid>
                        <Card.Grid
                            style={{ width: '25%', textAlign: 'center'}}
                            className={'bg-primary text-white cursor-pointer'}
                        >
                            Upload File
                        </Card.Grid>
                        <Card.Grid
                            style={{ width: '25%', textAlign: 'center'}}
                        >
                            View Data
                        </Card.Grid>
                    </Card>
                })
            }
        </>
    );
}
